  const url = req.url;
  if (url === "/protected") {
    return res.send("<h1> Not Allowed </h1>");
  }
  console.log("Allowed, You may continue");
  next();
};

const handleHome = (req, res) => {
  // return res.send("<h1 style='color:#f00;'>I still love You</h1>");
  return res.end();
};

